/* eslint-disable jsx-a11y/anchor-is-valid */
import React, { useState } from 'react';
import LandingPage from './HomePage';
import bgImg from '../../assests/smile.jpg'



function App() {
  const [darkMode, setdarkMode] = useState("has-background-black-bis")
  const [home, setHome] = useState(true)

  const toggleDarkMode = () => {
    setdarkMode("has-background-white-bis")
  }

  const toggleHome = () => {
    setHome(!home)
  }

  return (
    home ? (
    <section className={`hero is-fullheight is-dark is-bold ${darkMode}`}>
      <figure className="image">

      </figure>
      <div className="hero-head">

          <div className="container">

          </div>


      </div>


      <div className="hero-body">
        <div className="container has-text-centered">
          <h1 onClick={() => setHome(!home)} className="title">
            Zuby.io
      </h1>

        </div>
      </div>

      <div className="hero-foot">

      </div>
    </section>
    )
    : 
    <LandingPage />

  );
}

export default App;
